// import "./css/Main.css"


function Homepage() {
  return (
    <div className="Homepage">
      <h2>Welcome to this website</h2>

      <p>On June 6, 1944, the Allies landed on the beaches of Normandy during a short period of favorable
        weather, changing the course of World War II. 77 years later, the Imperial War Museum Duxford
        commemorated the soldiers, pilots and sailors who executed the landing against
        all odds with a D-Day anniversary air exhibit.</p>
      <p>On this site you will find three highlights of the day, a number of magnificent 
        images of the ‘heavy iron’ warbirds, information about participating in the air show, i
        nformation about the Imperial War Museum, and profiles of the photographers.</p>


      {/* <p><strong>Falling neatly on to the 77<sup>th</sup> Anniversary of the D-Day Landings, IWM Duxford’s
        second flying day of the year was a treat for all fans of the ‘heavy iron’ warbirds. As a showcase of flying,
        ‘Commemorating D-Day’ really did show off IWM Duxford’s flying displays at their very best on a very pleasant
        early summer afternoon. </strong></p>
      <p>With the world fighting for its own D-Day since the start of the COVID-19 pandemic,
        Duxford's second flying day aptly commemorated the start of Operation Overlord 77 years ago
        to the present day.</p> */}
      <img src="http://placekitten.com/g/600/400?image=9" alt="" />
    </div>



  );
}

export default Homepage;
